import React from "react";
import Modal from "react-bootstrap/Modal";
import Button from "react-bootstrap/Button";
import { Form } from "react-bootstrap";
import '/Psych-narc/client/src/styles/text-styles.css'

const LeaveFeedback = ({show, onHide}) => {
    return(
        <Modal
        style={{borderColor:'#1F674F'}}
        show={show}
        onHide={onHide}
        size="lg"
        centered
      >
          <Modal.Title className='display-2 ms-auto'>
            Оставить отзыв
          </Modal.Title>
        <Modal.Body>
          <Form>
            <Form.Control
                placeholder="Заголовок вопроса"
                style={{borderColor:'#1F674F', borderWidth:'1px'}}
            />
            <Form.Control
                placeholder="Ваше имя"
                style={{marginTop:'20px', borderColor:'#1F674F'}}
            />
            <Form.Control
                placeholder="Email"
                style={{marginTop:'20px', borderColor:'#1F674F'}}
            />
            <Form.Control
                placeholder="Пояснительный текст"
                style={{marginTop:'20px', borderColor:'#1F674F'}}
            />
          </Form>
        </Modal.Body>
        <Modal.Footer>
          <Button onClick={onHide}>Close</Button>
          <Button onClick={onHide}>Close</Button>
        </Modal.Footer>
      </Modal>
    )
}

export default LeaveFeedback;
